import React, { useState } from 'react';
import './App.css';
import Alo from './Fondos/1.png'

function App() {
  const [AloF,setAlo] = useState("Alo")
  function cambiarVelocidad() {
    setAlo("Alo2")
  };
  // const Estilos = {
  // Center: "relative z-10 w-[200px] h-[200px] border-8 border-solid border-black rounded-full bg-blue-200 Centro",
  // };
  return (
    <div className='Main'>
      <img className={AloF} src={Alo} alt='Alo'/>
      <button className="Centro" onClick={cambiarVelocidad} ></button>
    </div>
  );
}

export default App;
